import Header from "../components/header.js";
import Footer from "../components/Footer.js";

const gameFilmData = [
  {
    id: 1,
    name: "Orange Beanie - Nice to Meet Me",
    url: "https://www.youtube.com/watch?v=PE0CafPKZr0"
  },
  {
    id: 2,
    name: "Orange Beanie - Mathbook",
    url: "https://www.youtube.com/watch?v=oyWMkP1BfHo"
  },
  {
    id: 3,
    name: "Orange Beanie - Designer Hubcaps",
    url: "https://www.youtube.com/watch?v=kxFlk4bTCVo"
  },
  {
    id: 4,
    name: "Orange Beanie - No Lease",
    url: "https://www.youtube.com/watch?v=uaALo5vvIuc"
  },
  {
    id: 5,
    name: "Orange Beanie - They 2",
    url: "https://www.youtube.com/watch?v=kxFlk4bTCVo"
  },
  {
    id: 6,
    name: "Jerry Owens - Young Has Been",
    url: "https://www.youtube.com/watch?v=1qX-6RRImoY"
  },
  {
    id: 7,
    name: "Jerry Owens - Lonely",
    url: "https://www.youtube.com/watch?v=hEfr5DB4v8g"
  },
  {
    id: 8,
    name: "Jerry Owens - Edge of Madness",
    url: "https://www.youtube.com/watch?v=_n56k4TW3j4"
  },
  {
    id: 9,
    name: "Jerry Owens - Mundane Funday",
    url: "https://www.youtube.com/watch?v=3NAhy9yZfr8"
  }
];

const GameFilm = () => {
  return (
    <section className="gamefilm-page">
      <Header />
      <div className="content-wrapper w-container">
        <h1 className="page-title">Game Film</h1>
        <div className="w-dyn-list list-container">
          {gameFilmData.map(vid => (
            <div className="w-dyn-items w-row">
              <div className="collection-item w-dyn-item w-col w-col-4">
                <h3 className="heading-3">{vid.name}</h3>
                <div className="w-video w-embed"></div>
              </div>
            </div>
          ))}
        </div>
      </div>

      <Footer />
      <style jsx>
        {`
          body {
            height: 100vh;
          }
          .list-container {
            display: flex;
          }
        `}
      </style>
    </section>
  );
};

export default GameFilm;
